When you write CSS, the steps often go: Try getting the styles right in the DevTools Pick what elements to style Write the style rules Step 2 in the steps to writing CSS is ‚ÄúPick what elements to style‚Äù. Selectors say which elements will get which styles . <p> This is a paragraph. It has an <a href="https://example.com">Example Link</a> inside the paragraph.
</p>
<p>Here's a second paragraph</p> p { color: red;
} a { color: green;
} This is a paragraph. It has an Example Link inside the paragraph. Here‚Äôs a second paragraph. The selectors here are p and a. Which elements get color: red;? The paragraphs, because of the p selector. Which elements get color: green;? The link, because of the a selector.

