When an element has a class attribute, there‚Äôs special syntax to select them. <p>This is a paragraph.</p>
<p class="cool-paragraph">Here's a second paragraph</p> p { color: red;
} .cool-paragraph { color: green;
} This is a paragraph. Here‚Äôs a second paragraph The selector .cool-paragraph selected the second paragraph, because it had a matching class attribute. The general syntax is . plus the name of the class (cool-paragraph). You can have lots of elements with the same class. There can be lots of cool-paragraphs.

