An id selector selects elements that have a matching id. It‚Äôs similar to a class selector, just a slightly different syntax. <p>Another paragraph.</p>
<p id="paragraph-6">Here's the sixth paragraph</p> #paragraph-6 { color: green;
} Another paragraph. Here‚Äôs the sixth paragraph #paragraph-6 picks the paragraph with the id paragraph-6. The syntax is a # plus the id (like paragraph-6). There‚Äôs only supposed to be one element with any particular id.

