If you‚Äôre going to use the same value in lots of places in your CSS code, there‚Äôs a really useful tool: CSS variables . Here‚Äôs how they work. html { --theme: #D231A0;
} a:hover { color: var(--theme); text-decoration-color: var(--theme);
} This snippet creates a CSS variable called --theme, then uses it as the color for the text and the underline when a link is hovered. When the browser sees var(--theme), it looks up the variable --theme and uses that value, #D231A0. You can use CSS variables for any values ‚Äî colors, sizes, numbers, percentages, or any other property values. CSS variables are really useful for color palettes, since it‚Äôs common to use the same colors again and again.

